import React from "react";
import { useParams } from 'react-router-dom';
const NotePage = ({match}) => {
    const { id } = useParams()

    return(
        <div>
            <h3>Single Note</h3>
            <h4>Note id: {id}</h4>
        </div>
    )
}

export default NotePage
